import sys, heapq

def main():
    N, K = map(int, sys.stdin.readline().rstrip().split())
    A = list(map(int, sys.stdin.readline().rstrip().split()))

    # Create a max heap with the heapq module.
    heap = []
    for i in range(N):
        heapq.heappush(heap, -1 * A[i])

    # Pop the first K elements from the heap.
    for i in range(K):
        print(-1 * heapq.heappop(heap))

if __name__ == '__main__':
    main()


import sys

def main():
    # read the input and convert to integers
    line = sys.stdin.readline().split()
    N = line[0]
    C = line[1]
    N = int(N)
    C = int(C)
    seq = sys.stdin.readline().split()
    for i in range(N):
        seq[i] = int(seq[i])
    # create a dictionary of counts
    counts = {}
    for i in range(N):
        if seq[i] not in counts:
            counts[seq[i]] = 1
        else:
            counts[seq[i]] += 1
    # sort the dictionary by value
    sorted_counts = sorted(counts.items(), key=lambda tup: tup[1], reverse=True)
    # create a list of lists and flatten it
    sorted_seq = []
    for i in range(len(sorted_counts)):
        sorted_seq.append([])
        for j in range(N):
            if seq[j] == sorted_counts[i][0]:
                sorted_seq[i].append(seq[j])
    # flatten the list
    sorted_seq = [item for sublist in sorted_seq for item in sublist]
    # print the output
    for i in range(N):
        print(sorted_seq[i], end=" ")
    print("")

